import React from 'react';
import './HomePage.css'; // Importing the CSS file

const HomePage = () => {
  return (
    <div className="home-page">
      <main className="main-content">
        <section className="welcome-message">
          <h2>Welcome to the Client Management System</h2>
          <p className="intro-text">This system allows you to manage your clients efficiently.</p>
          <p className="instruction-text">To get started, click on the "Login" button in the header.</p>
        </section>
      </main>
    </div>
  );
};

export default HomePage;
